(195, 1, '2020-11-26 15:31:19', '2020-11-26 15:31:19', '<!-- wp:image {\"id\":194,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/wordpress/wp-content/uploads/2020/11/banniere.jpg\" alt=\"\" class=\"wp-image-194\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Suspendisse potenti. Nullam ac risus quis est viverra ultricies sit amet auctor erat. Donec posuere augue lorem, a cursus turpis sollicitudin a. In faucibus luctus ex, quis venenatis justo bibendum a. Cras sit amet tortor malesuada, posuere ligula vel, elementum magna. Etiam hendrerit, quam eget vehicula gravida, sem arcu porttitor erat, finibus scelerisque massa quam quis libero. Etiam tortor est, convallis in tempus in, interdum a justo. Curabitur ac auctor elit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sed at scelerisque justo. Etiam auctor ligula in pulvinar ultricies. Sed fermentum arcu at odio ullamcorper maximus. Duis consequat massa augue. Mauris a tortor non ante condimentum porta non vitae erat. Suspendisse venenatis purus sit amet fermentum vehicula. Etiam lacinia lacus eget quam sodales, ac volutpat velit feugiat. Aenean erat urna, posuere vitae semper in, tristique sit amet ante.</p>\n<!-- /wp:paragraph -->', 'Dev web', '', 'inherit', 'closed', 'closed', '', '39-revision-v1', '', '', '2020-11-26 15:31:19', '2020-11-26 15:31:19', '', 39, 'http://localhost/wordpress/?p=195', 0, 'revision', '', 0),
