(197, 1, '2020-11-26 16:13:14', '2020-11-26 16:13:14', '<!-- wp:paragraph -->\n<p><strong><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\">Lorem Ipsum</font></font></strong><font style=\"vertical-align: inherit;\"><font style=\"vertical-align: inherit;\"> &nbsp;est simplement un texte factice de l\'industrie de l\'impression et de la composition. Lorem Ipsum est le texte factice standard de l\'industrie depuis les années 1500, quand un imprimeur inconnu a pris une galère de caractères et l\'a brouillée pour faire un livre de spécimens. Il a survécu non seulement cinq siècles, mais aussi le saut dans la composition électronique, demeurant essentiellement inchangé. Il a été popularisé dans les années 1960 avec la sortie de feuilles Letraset contenant des passages du Lorem Ipsum, et plus récemment avec un logiciel de publication assistée par ordinateur comme Aldus PageMaker comprenant des versions de Lorem Ipsum.</font></font></p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-11-26 16:13:14', '2020-11-26 16:13:14', '', 1, 'http://localhost/wordpress/?p=197', 0, 'revision', '', 0),
